    start2, end2 = interval2

    if end1 < start2 or end2 < start1:
        return "NO"

    intersection_start = max(start1, start2)
    intersection_end = min(end1, end2)

    intersection_length = intersection_end - intersection_start + 1

    if intersection_length <= 1 or is_prime(intersection_length):
        return "NO"
    else:
        return "YES"

from itertools import product

def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])
    visited = [[False for _ in range(m)] for _ in range(n)]

    def dfs(i, j, path):
        if i < 0 or i >= n or j < 0 or j >= m or visited[i][j]:
            return
        path.append(grid[i][j])
        visited[i][j] = True
        if len(path) == k:
            return path
        res = []
        for x, y in product([-1, 0, 1], repeat=2):
            if x == 0 and y == 0:
                continue
            temp = dfs(i+x, j+y, path.copy())
            if temp:
                res.append(temp)
        visited[i][j] = False
        return min(res, default=None)

    for i in range(n):
        for j in range(m):
            path = dfs(i, j, [])
            if path:
                return path

