def encrypt(s):
    result = ""
    for char in s:
        if char.isalpha():
            shift = (ord(char) - ord('a') + 2) * 2
            if char.islower():
                result += chr((ord('a') + (shift % 26)))
            else:
                result += chr((ord('A') + (shift % 26)))
        else:
            result += char
    return result

