def compare_one(a, b):
    if type(a) != type(b):
        if isinstance(a, (int, float)) and isinstance(b, (int, float)):
            return a if a > b else b
        elif isinstance(a, (int, float)):
            return a
        elif isinstance(b, (int, float)):
            return b
        else:
            a = a.replace(',', '.')
            return a if float(a) > float(b) else b
    else:
        if a > b:
            return a
        elif b > a:
            return b
        else:
            return None

