def do_algebra(operator, operand):
    precedence = {'**': 3, '*': 2, '/': 2, '+': 1, '-': 1}

    def apply_operation(operators, operands):
        while len(operators) > 0 and precedence.get(operators[-1], 0) >= precedence.get(operators[-2], 0):
            op = operators.pop()
            b = operands.pop()
            a = operands.pop()
            if op == '**':
                operands.append(a ** b)
            elif op == '*':
                operands.append(a * b)
            elif op == '/':
                operands.append(a // b)
            elif op == '+':
                operands.append(a + b)
            elif op == '-':
                operands.append(a - b)

    operators = []
    operands = []

    for i in range(len(operator)):
        if operator[i] in precedence:
            apply_operation(operators, operands)
            operators.append(operator[i])
        operands.append(operand[i])

    apply_operation(operators, operands)

    return operands[0]

