def change_base(x: int, base: int):
    if x == 0:
        return '0'
    digits = '0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZ'
    result = ''
    while x > 0:
        digit = x % base
        result = digits[digit] + result
        x //= base
    return result

