import math

def poly(xs: list, x: float):
    return sum([coeff * math.pow(x, i) for i, coeff in enumerate(xs)])

def find_zero(xs: list):
    def poly_zero(x):
        return poly(xs, x)

    zeros = [x for x in range(-1000, 1000) if math.isclose(poly_zero(x), 0, abs_tol=1e-9)]
    return zeros[0] if zeros else None

def separate_paren_groups(paren_string: str) -> List[str]:
    result = []
    count = 0
    current_group = ""
    for char in paren_string:
        if char == '(':
            count += 1
        elif char == ')':
            count -= 1
        if char != ' ':
            current_group += char
        if count == 0 and current_group:
            result.append(current_group)
            current_group = ""
    return result

def make_palindrome(string: str) -> str:
    def is_palindrome(s):
        return s == s[::-1]

    if not string:
        return ''

    if is_palindrome(string):
        return string

    for i in range(len(string), 0, -1):
        if is_palindrome(string[:i]):
            return string + string[:i][::-1]

    return string + string[:-1][::-1]

def encode_cyclic(s: str):
    groups = [s[(3 * i):min((3 * i + 3), len(s))] for i in range((len(s) + 2) // 3)]
    groups = [(group[-1] + group[:-1]) if len(group) == 3 else group for group in groups]
    return "".join(groups)

def decode_cyclic(s: str):
    groups = [s[(3 * i):min((3 * i + 3), len(s))] for i in range((len(s) + 2) // 3)]
    groups = [(group[1:] + group[0]) if len(group) == 3 else group for group in groups]
    return "".join(groups)

def parse_music(music_string: str) -> List[int]:
    durations = {'o': 4, 'o|': 2, '.|': 1}
    notes = music_string.split()

    result = []
    for note in notes:
        if note in durations:
            result.append(durations[note])
        else:
            if '|' in note:
                note_type, repeat = note.split('|')
                result.extend([durations[note_type]] * int(repeat))
            else:
                result.append(int(note))

    return result

