from itertools import product

def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])
    visited = [[False for _ in range(m)] for _ in range(n)]

    def dfs(i, j, path):
        if i < 0 or i >= n or j < 0 or j >= m or visited[i][j]:
            return
        path.append(grid[i][j])
        visited[i][j] = True
        if len(path) == k:
            visited[i][j] = False
            return path.copy()
        res = []
        for x, y in product([-1, 1, 0], repeat=2):
            res.append(dfs(i+x, j+y, path))
        visited[i][j] = False
        return min(filter(None, res))

    for i in range(n):
        for j in range(m):
            path = dfs(i, j, [])
            if path:
                return path
    return []

