def do_algebra(operator, operand):
    precedence = {'+': 1, '-': 1, '*': 2, '//': 2, '**': 3}

    def apply_operation(operands, operator):
        b = operands.pop()
        a = operands.pop()
        if operator == '+':
            return a + b
        elif operator == '-':
            return a - b
        elif operator == '*':
            return a * b
        elif operator == '//':
            return a // b
        elif operator == '**':
            return a ** b

    stack = []
    for i in range(len(operator)):
        while stack and precedence[operator[i]] <= precedence[stack[-1]]:
            stack.append(apply_operation(stack, stack.pop()))
        stack.append(operand[i])

    while len(stack) > 1:
        stack.append(apply_operation(stack, stack.pop()))

    return stack[0]
